import React from 'react';
import logo from "./comarca-logo-ok.png"
import "./Navbar.css";

//IMPORT LINKS
import { Link } from 'react-router-dom';

//BOOTSTRAP
import "bootstrap/dist/css/bootstrap.min.css";

import { Navbar, Nav, Button, NavDropdown } from 'react-bootstrap';


function navbar({item1, item2, item3, subitem1, subitem2, subitem3, subitem4}) {
    return (
        <Navbar expand="lg" className="nav-container">
            <Navbar.Brand><Link><img width="200" className="d-inline-block align-top" src={logo} alt="comarca de creadores logo" /></Link></Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="mr-auto">
                    <NavDropdown title= {item1} id="basic-nav-dropdown">
                        <NavDropdown.Item href="#">{subitem1}</NavDropdown.Item>
                        <NavDropdown.Item href="#">{subitem2}</NavDropdown.Item>
                        <NavDropdown.Item href="#">{subitem3}</NavDropdown.Item>
                        <NavDropdown.Item href="#">{subitem4}</NavDropdown.Item>
                    </NavDropdown>
                    <Nav.Link href="#link"> {item2} </Nav.Link>
                    <Nav.Link href="#link"> {item3} </Nav.Link>
                </Nav>
                <Button id="cart-button" className="cart-button" style={{backgroundColor:"#c59534", outline:"0", border: "none"}}><i className="fas fa-shopping-cart"></i></Button> 
            </Navbar.Collapse>
        </Navbar>
    );
};

export default navbar;
